package com.edw590.visor_c_a;

/**
 * <p>Raw data of files.</p>
 * <p>Instead of being copied to the device, they can be read directly from the APK by reading a string which contains
 * the data.</p>
 */
public final class RawFiles {

    /*
    The maximum length of a string in Java is 64 kB. So, if more is needed, simply use various strings and concatenate
    them all, and read the 3rd point about it.

    - The 1st element is the name of the file (which is supposed to be in the internal app data folder just in case it's
      needed);
    - The 2nd element is the size of the buffer, in case it's needed to get it to play with AudioTrack or some other
      that needs to have a buffer size (the formula for WAV files is in the end of this comment);
    - The 3rd element (or more, in case it's needed more than 64 kB) is the file encoded in Base64.

    5 sec * 44100 samples per sec * 2 bytes per sample * 2 channels = 882 000 bytes
    */

	public static final String[] CAMERA_FOCUS = {
			"camera-focus-beep-01.wav",
			"176400",// 1 * 44100 * 2 * 2 = 176400
			"data:audio/mpeg;base64,",
	};
	public static final String[] CAMERA_SHUTTER = {
			"camera-shutter-click-08.wav",
			"176400",// 1 * 44100 * 2 * 2 = 176400
			"data:audio/mpeg;base64,",
	};

	/**
	 * <p>Private empty constructor so the class can't be instantiated (utility class).</p>
	 */
	private RawFiles() {
	}
}
